import React, { Component } from 'react';
import Head from 'next/head';

class AboutUsIntro extends Component {
    render() {
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" />
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <div className="banner">
                    <div className="container">
                        <img src="images/banner.jpg" alt="Image Description" />
                        <span className="img-shape">
                            <img src="images/icon-leaf.png" alt="image description" />
                        </span>
                    </div>
                </div>
                <div className="intro">
                    <span className="img-shape">
                        <img src="images/icon-leaf-small.png" alt="image description" />
                    </span>
                    <h1>About Us</h1>
                    <p>Aesthetic Record began out of necessity in 2014 when our Founder & CEO could not find an aesthetics-focused EMR that was affordable, scalable, and effective as his new practice began to grow. Fast forward to 2017, and what started out as a custom platform became commercially available to other aesthetic practitioners. Over the last several years, our team has invested hundreds of thousands of hours in development to build an end-to-end system that can manage the complex daily operations of an Aesthetic clinic. Those few key features have grown into a robust solution that powers practices of all kinds from single locations to large franchises and facilitates patient interactions both in-person and virtually.</p>
                    <p> One of our guiding principles at Aesthetic Record is that no matter the size, HIPAA-compliant documentation, clinical photography and inventory management should be available to everyone. As our feature list has continued to evolve, weâ€™ve remained committed to keeping our system affordable by providing tremendous value at a price point every clinic can afford. We personally onboard each of our customers so we can ensure they have the tools they need to maximize each component of Aesthetic Record. We listen very closely to the needs of the marketplace and maintain a steady stream of innovation to meet the changing demands of our industry. Our customers are their patients are at the heart of everything we do, and we are greatful that so many clinics around the world trust Aesthetic Record to power their operations everyday.</p>
                </div>
            </div>
        );
    }
}

export default AboutUsIntro;
